export default function searchingredient() {
    return (
<div> 
    <div className= "ingredient-container" style={{ backgroundImage: `url(${food2})`, backgroundSize: "cover", height:"100vh", backgroundPosition:"center"}}/>
    <div>
        <Nav/> 
        {/* <SearchBar/>  */}
        <SearchByIngredientContainer />
    </div>
</div>
    )
}


